        .asciinema-player-wrapper:-webkit-full-screen.hud .title-bar {

        .asciinema-player-wrapper .asciinema-player {
            text-align: left;
            display: inline-block;
            padding: 0px;
            position: relative;
            box-sizing: content-box;
            -moz-box-sizing: content-box;
            -webkit-box-sizing: content-box;
            overflow: hidden;
            max-width: 100%;
        }

        .asciinema-terminal {
            box-sizing: content-box;
            -moz-box-sizing: content-box;
            -webkit-box-sizing: content-box;
            overflow: hidden;
            padding: 0;
            margin: 0px;
            display: block;
            white-space: pre;
            border: 0;
            word-wrap: normal;
            word-break: normal;
            border-radius: 0;
            border-style: solid;
            cursor: text;
            border-width: 0.5em;
            font-family: Consolas, Menlo, "Bitstream Vera Sans Mono", monospace,
                "Powerline Symbols";
            line-height: 1.3333333333em;
        }

        .asciinema-terminal .line {
            letter-spacing: normal;
            overflow: hidden;
            height: 1.3333333333em;
        }

        .asciinema-terminal .line span {
            padding: 0;
            display: inline-block;
            height: 1.3333333333em;
        }

        .asciinema-terminal .line {
            display: block;
            width: 200%;
        }

        .asciinema-terminal .bright {
            font-weight: bold;
        }

        .asciinema-terminal .underline {
            text-decoration: underline;
        }

        .asciinema-terminal .italic {
            font-style: italic;
        }

        .asciinema-terminal.font-small {
            font-size: 12px;
        }

        .asciinema-terminal.font-medium {
            font-size: 18px;
        }

        .asciinema-terminal.font-big {
            font-size: 24px;
        }

        .asciinema-player .control-bar {
            width: 100%;
            height: 32px;
            background: rgba(0, 0, 0, 0.8);
            /* no gradient fallback */
            background: -moz-linear-gradient(top,
                    rgba(0, 0, 0, 0.5) 0%,
                    #000000 25%,
                    #000000 100%);
            /* FF3.6-15 */
            background: -webkit-linear-gradient(top,
                    rgba(0, 0, 0, 0.5) 0%,
                    #000000 25%,
                    #000000 100%);
            /* Chrome10-25,Safari5.1-6 */
            background: linear-gradient(to bottom,
                    rgba(0, 0, 0, 0.5) 0%,
                    #000000 25%,
                    #000000 100%);
            /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
            color: #bbbbbb;
            box-sizing: content-box;
            line-height: 1;
            position: absolute;
            bottom: -35px;
            left: 0;
            transition: bottom 0.15s linear;
        }

        .asciinema-player .control-bar * {
            box-sizing: inherit;
            font-size: 0;
        }

        .asciinema-player .control-bar svg.icon path {
            fill: #bbbbbb;
        }

        .asciinema-player .control-bar .playback-button {
            display: block;
            float: left;
            cursor: pointer;
            height: 12px;
            width: 12px;
            padding: 10px;
        }

        .asciinema-player .control-bar .playback-button svg {
            height: 12px;
            width: 12px;
        }

        .asciinema-player .control-bar .timer {
            display: block;
            float: left;
            width: 50px;
            height: 100%;
            text-align: center;
            font-family: Helvetica, Arial, sans-serif;
            font-size: 11px;
            font-weight: bold;
            line-height: 32px;
            cursor: default;
        }

        .asciinema-player .control-bar .timer span {
            display: inline-block;
            font-size: inherit;
        }

        .asciinema-player .control-bar .timer .time-remaining {
            display: none;
        }

        .asciinema-player .control-bar .timer:hover .time-elapsed {
            display: none;
        }

        .asciinema-player .control-bar .timer:hover .time-remaining {
            display: inline;
        }

        .asciinema-player .control-bar .progressbar {
            display: block;
            overflow: hidden;
            height: 100%;
            padding: 0 10px;
        }

        .asciinema-player .control-bar .progressbar .bar {
            display: block;
            cursor: pointer;
            height: 100%;
            padding-top: 15px;
            font-size: 0;
        }

        .asciinema-player .control-bar .progressbar .bar .gutter {
            display: block;
            height: 3px;
            background-color: #333;
        }

        .asciinema-player .control-bar .progressbar .bar .gutter span {
            display: inline-block;
            height: 100%;
            background-color: #bbbbbb;
            border-radius: 3px;
        }

        .asciinema-player .control-bar.live .progressbar .bar {
            cursor: default;
        }

        .asciinema-player .control-bar .fullscreen-button {
            display: block;
            float: right;
            width: 14px;
            height: 14px;
            padding: 9px;
            cursor: pointer;
        }

        .asciinema-player .control-bar .fullscreen-button svg {
            width: 14px;
            height: 14px;
        }

        .asciinema-player .control-bar .fullscreen-button svg:first-child {

        .asciinema-player .control-bar .fullscreen-button svg:last-child {

        .asciinema-player-wrapper:fullscreen .fullscreen-button svg:first-child {

        @-webkit-keyframes expand {
            0% {
                -webkit-transform: scale(0);
            }

            50% {
                -webkit-transform: scale(1);
            }

            100% {
                z-index: 1;
            }
        }

        @-moz-keyframes expand {
            0% {
                -moz-transform: scale(0);
            }

            50% {
                -moz-transform: scale(1);
            }

            100% {
                z-index: 1;
            }
        }

        @-o-keyframes expand {
            0% {
                -o-transform: scale(0);
            }

            50% {
                -o-transform: scale(1);
            }

            100% {
                z-index: 1;
            }
        }

        @keyframes expand {
            0% {
                transform: scale(0);
            }

            50% {
                transform: scale(1);
            }

            100% {
                z-index: 1;
            }
        }

        .loader {
            position: absolute;
            left: 50%;
            top: 50%;
            margin: -20px 0 0 -20px;
            background-color: white;
            border-radius: 50%;
            box-shadow: 0 0 0 6.66667px #141414;
            width: 40px;
            height: 40px;
        }

        .loader:before,
        .loader:after {
            content: "";
            position: absolute;
            left: 50%;
            top: 50%;
            display: block;
            margin: -21px 0 0 -21px;
            border-radius: 50%;
            z-index: 2;
            width: 42px;
            height: 42px;
        }

        .loader:before {
            background-color: #141414;
            -webkit-animation: expand 1.6s linear infinite both;
            -moz-animation: expand 1.6s linear infinite both;
            animation: expand 1.6s linear infinite both;
        }

        .loader:after {
            background-color: white;
            -webkit-animation: expand 1.6s linear 0.8s infinite both;
            -moz-animation: expand 1.6s linear 0.8s infinite both;
            animation: expand 1.6s linear 0.8s infinite both;
        }
